import React from "react";
import "./Train_vdo.css";


function Train_vdo() {
    return (
        <>
            <img className="JSPL_LOGO"
                src={require('https://tenor.com/en-GB/view/train-gif-24210416')}
                alt="Jspl-logo" />
        </>
    );
}
export default Train_vdo;
